  false,\n\t\"url\": null,\n\t\"notes\": \"Funding from this grant will provide funds
  to hire either an AmeriCorps member or independent contractor through the Refugeu2019s
  Friendu2019s Group. The AmeriCorps member/contractor will assist with coordinating
  the Refuge EDRRP through the summer of 2016. The AmeriCorps member/contractor, Refuge
  Wildlife Biologist, Volunteer Coordinator and Friends of Turnbull NWR will recruit
  and train volunteers in the use of GPS equipment, survey software and EDRRP protocols.
  Several areas treated for the control of medusa-head wild- rye will be seeded with
  native grasses.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
